import React from "react";
import Header from "../Components/header";
import Button from '@material-ui/core/Button';
import { Link } from "react-router-dom";
import { TextField } from "@material-ui/core";


const Splash = function(){
    function handleSignin(event){
        event.preventDefault();
    }
    return <div>
        <Header></Header>
        <div className="buttons">
        <h1>SignIn</h1>
        <form onSubmit={handleSignin}>
            <TextField></TextField>
            <input name="email" type="email" placeholder="Enter your Email" ></input>
            <input name="password" type="password" placeholder="Enter your Password"></input>
            <button type="submit" >Sign In</button><br></br>
            <Link to="/forgotpassword"><a style={{color:"white"}}>Fotgot Password?</a></Link>
        </form>
        <h4>Don't have account?</h4>
        <Link to="/signup"><Button children="Sign up" size="large" variant="contained"  style={{borderRadius:20}} ></Button></Link> 
        </div>
    </div>
}
export default Splash;
